import Typed from "typed.js";

const heroLogic = async () => {
  const whatAmIStrings = ["nait graduate", "coder", "dungeon master", "cat mom", "coffee addict"];
  const typedOptions = {
    strings: "strings",
    typeSpeed: 50,
    backSpeed: 50,
    loop: true,
  };
  const myTyped = await document.querySelector(".hero-h1-dynamic-text");
  myTyped = new Typed(".hero-h1-dynamic-text", whatAmIStrings, typedOptions);
};
